webpackJsonp([0x6c7a0b47200d],{4832:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Wednesday before CeBIT",date:"23 Feb 2000",slug:"/2000-02-23-wednesday-before-cebit/",tags:"Y2000"},html:'<p>I\'ve been <a href="http://2020hindsight.editthispage.com/">hyptonized</a> <i>Marlene is now in my template!</i></p>\n<p>The Far Side of My Mind <a href="http://farsideofmymind.editthispage.com/stories/storyReader$51">CeBIT Preparations</a>: These pictures show why I\'m glad I can stay home!</p>\n<p>CNNSI: <a href="http://cnnsi.com/soccer/world/news/2000/02/23/germany_netherlands_ap/">Matthäus\' record 144th cap spoiled in loss to Dutch</a>: "The Dutch confirmed their role as Euro 2000 favorites Wednesday by beating reigning European champion Germany 2-1 with a show of dazzling skills that should have yielded more goals." <i>I fell asleep on the couch during this game.</i></p>'},next:{fields:{title:"Tuesday",date:"22 Feb 2000",slug:"/2000-02-22-tuesday/"}},previous:{fields:{title:"CeBIT Thursday",date:"24 Feb 2000",slug:"/2000-02-24-cebit-thursday/"}}},{node:{fields:{title:"Tuesday",date:"22 Feb 2000",slug:"/2000-02-22-tuesday/",tags:"Y2000"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/02/crh0222.jpg" height="336" width="350" border="0" alt="crh0222.jpg: " /></p>\n<p>Just fed. Mama\'s reaction: "There\'s no alcohol in m milk, honest!"</p>\n<p><a href="http://www.wired.com/news/business/0,1367,34471,00.html">Wired</a>: "AOL Europe announced Tuesday that it plans to give all German primary and secondary schools and 900,000 German schoolteachers free access to the Internet." <i>(Via <a href="http://www.scripting.com">scriptingnews</a>) AOL Europe is located in Hamburg on Millerntorplatz, at the foot of the world-famous Reeperbahn. More on that location later.</i></p>\n<p><a href="http://ravenx.editthispage.com/2000/02/20">Raven X</a>: 11 things they didn\'t teach you in school. <i>(Via <a href="http://carpediem.editthispage.com">carpediem</a>)</i></p>'},next:{fields:{title:"Monday",date:"21 Feb 2000",slug:"/2000-02-21-monday/"}},previous:{fields:{title:"Wednesday before CeBIT",date:"23 Feb 2000",slug:"/2000-02-23-wednesday-before-cebit/"}}},{node:{fields:{title:"Monday",date:"21 Feb 2000",slug:"/2000-02-21-monday/",tags:"Y2000"},html:'<p>ETPers working on taxes (a list in progress): <a href="http://cuwu.editthispage.com/2000/02/20">curmudgeon</a> <a href="http://array.editthispage.com/2000/02/21">array</a>. I just finished my <i>1998</i> German taxes in December. <i>Hee hee</i></p>\n<p>German income tax is like US income tax back in the \'70s. Very complicated and very expensive. Lots of rules and lots of deductions. The fifty-percent tax bracket is alive and well. However, my experience is that, unlike the American IRS, the German Finanzamt is staffed by living, feeling human beings. It\'s a local office rather than a faceless national bureaucracy.</p>\n<p>Another <a href="http://shanson.editthispage.com/stories/storyReader$125">German ETP Site</a>: <a href="http://jcmetzger.editthispage.com/">tägliche Nachrichten</a> As far as I can tell, only the the title is German, but I won\'t be fussy</p>\n<p><a href="http://www.hardocp.com/news_images/2000/february_2000/bsod.jpg"><img src="http://shanson.editthispage.com/picture$160" align="right" border="0" /></a>From debian-devel: <a href="http://www.hardocp.com/news_images/2000/february_2000/bsod.jpg">Blue Screen of Death</a></p>\n<p><a href="http://www.ftd.de/cgi-bin/gx.cgi/AppLogic+FTContentServer?pagename=HomePage">Financial Times Deutschland</a> A new national business newspaper in Germany. <i>It\'s pink, like the UK version.</i></p>'},next:{fields:{title:"Sunday",date:"20 Feb 2000",slug:"/2000-02-20-sunday/"}},previous:{fields:{title:"Tuesday",date:"22 Feb 2000",slug:"/2000-02-22-tuesday/"}}}],pathPrefix:"",first:!1,last:!1,index:1077,pageCount:1101}}}});
